import { Container } from "react-bootstrap";
import Signup from "./Components/Auth/Signup";

function App() {
  return (
    <div className="App">
      <Container className="d-flex align-items-center justify-content-center"
        style={{ height: "100vh" }}
      >
        <div className="w-100" style={{ maxWidth: "400px" }}>
          <Signup />
        </div>
      </Container>
    </div>
  );
}

export default App;
